from src.utils.RESOURCES import Resources


class SpecialSquare:
    pass


class Square:
    '''
    Represent a single square from the huge Dofus map.
        adjs is represented this way:
        [DIRECTION.UP, DIRECTION.RIGHT, DIRECTION.DOWN, DIRECTION.LEFT]
    '''

    def __init__(self,
                 id: str,
                 x: int,
                 y: int,
                 city: str,
                 place: str,
                 adjs: list[str],
                 resources: list[tuple[Resources, int]],
                 specialSquares: list[SpecialSquare]
                 ):
        self.id = id
        self.x = x
        self.y = y
        self.city = city
        self.place = place
        self.adjs = adjs
        self.resources = resources
        self.specialSquares = specialSquares

    def __repr__(self):
        return 'Square(id="{id}", x={x}, y={y}, city="{city}", place="",' \
                         ' adjs={adjs}, resources={resources}, specialSquares=[]),\n' \
                    .format(id=self.id, x=self.x, y=self.y, city=self.city, adjs=self.adjs, resources=[('C.'+resource.name, nb) if type(resource) == C else
                                                                                                       ('Fi.'+resource.name, nb) if type(resource) == Fi else
                                                                                                       ('Fl.'+resource.name, nb) if type(resource) == Fl else
                                                                                                       ('O.'+resource.name, nb) if type(resource) == O else
                                                                                                       ('W.'+resource.name, nb) if type(resource) == W else ()
                                                                                                       for resource, nb in self.resources])


